INSERT INTO `article` (`article_id`, `name`, `title`, `content`, `author_name`, `last_editor_name`, `create_date`, `last_edit_date`) VALUES
(1, 'evenements', 'Les regates a venir', 'REGATE A CARMAUX<br /><br />DIMANCHE 14 JANVIER &nbsp; &nbsp;9H &nbsp; &nbsp;REGATE VRC &nbsp;VOILE RADIO COMMANDEE&nbsp;<br />&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; CLASSE 1 METRE &nbsp; &nbsp;GRADE 5A<br /><br /><br />DIMANCHE 8 AVRIL &nbsp; &nbsp; &nbsp; 9H &nbsp; &nbsp;REGATE OPTIMIST&nbsp;<br />&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;REGATE INTERSERIE DERIVEUR', 'ADMIN', 'Alvernhe Thierry', '2017-11-15 14:58:39', '2017-12-27 23:46:41'),
(2, 'pratique_deriveur', 'Pratique du dériveur', 'On appelle &nbsp;DERIVEUR &nbsp;tout voilier qui a la proprit&eacute; des posseder une quille relevable&nbsp;<br />Generalement ce sont des bateaux de petite longueur souvent inferieure &agrave; 6 ou 7 metres.<br />Le plus petit et sans doute le plus connus de tous &nbsp;est l\'OPTIMIST , dont beaucoup d\'enfant ont pu s\'initier dans les ecoles. Il sadresse &nbsp;bien sur a des enfants et n\'est pas du tout adapt&eacute; pour des adultes, beaucoup trop grands. Il est dot&eacute; d\'une seule voile , et on manoeuvre le gouvernail pour tourner.<br />Tres pris&eacute; dans les ecoles de voile il va permettre d\'initier les enfants et leur faire comprendre la technique de la voile et comment utiliser un voilier pour se rendre &nbsp;o&ugrave; l\'on veut. Pour des gabarits plus grands on utilisera le LASER , voilier &agrave; une seule place tres sportif et qui demande des connaissance techniques plus intenses , ou &nbsp;des deriveurs doubles (2places) comme le 420 ou le 470 plus sportif mais lui aussi tres technique.<br />Le catamarran est lui aussi un deriveur &agrave; deux coques ce qui lui vaut une plus grande stabilit&eacute; et de belles performances et sensations, tout en restant simple d\'utilisation.', 'ADMIN', 'Alvernhe Thierry', NULL, '2017-12-27 23:47:07'),
(3, 'pratique_vrc', 'Pratique de la VRC', '<div style="color: #000000; background-color: rgba(0, 0, 0, 0); font-family: \'Arial Black\', Gadget, sans-serif;"><span style="font-family: \'Arial Black\', Gadget, sans-serif; color: #000000; background-color: rgba(0, 0, 0, 0);">Afin de permettre &agrave; tous ses membres de s\'initier &agrave; la VRC dite Voile Radio Command&eacute;e, <br />L\'USC Voile vient d\'acqu&eacute;rir une nouvelle flotte de 6 Dragon Force.</span><br /><br /><u>DESCRIPTION DU DRAGON FORCE:</u></div>\n<div style="color: #000000; background-color: rgba(0, 0, 0, 0); font-family: \'Arial Black\', Gadget, sans-serif;"><img style="display: block; margin-left: auto; margin-right: auto;" src="https://4.bp.blogspot.com/-i5SilQPz49Q/WQSOpExtrVI/AAAAAAAAS-U/m9kP43UYl9A-pbWfR6K6ywNG0Tbb7J5sQCLcB/s640/Fond%2Bd%2527%25C3%25A9cran.jpg" alt="VRC Dragon Force" width="328" height="218" /></div>\n<div style="color: #323d4f; font-family: \'Lucida Grande\', \'Trebuchet MS\', Helvetica, Arial, sans-serif; font-size: 13px; line-height: 18.200000762939453px; background-color: #ececec;"><u>Dimensions : &nbsp;</u> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</div>\n<div style="color: #323d4f; font-family: \'Lucida Grande\', \'Trebuchet MS\', Helvetica, Arial, sans-serif; font-size: 13px; line-height: 18.200000762939453px; background-color: #ececec;">- Mat 910mm &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</div>\n<div style="color: #323d4f; font-family: \'Lucida Grande\', \'Trebuchet MS\', Helvetica, Arial, sans-serif; font-size: 13px; line-height: 18.200000762939453px; background-color: #ececec;">- Coque &nbsp;80 et quille/lest 350 soit 1334 mm. Longueur du bateau : 65cm&nbsp;&nbsp; &nbsp; &nbsp;</div>\n<div style="color: #323d4f; font-family: \'Lucida Grande\', \'Trebuchet MS\', Helvetica, Arial, sans-serif; font-size: 13px; line-height: 18.200000762939453px; background-color: #ececec;"><u>Masses :&nbsp;</u></div>\n556 lest + 101 quille + 79 gr&eacute;ement + 484 coque &eacute;quip&eacute;e (&eacute;lectronique origine) + 40g<br />accus 700 mAh LIFE = 1250g<br /><br />La voile Radiocommand&eacute;e s\'adresse &agrave; tous public , meme ceux qui ne savent pas nager.<br />Il sagit de faire naviguer des mod&egrave;les reduits des repliques de grands voiliers de course <br />transoc&eacute;aniques. <br />Le voilier est constitu&eacute; d\'une ou 2 voiles , et d\'un gouvernail. La commande des voiles et de la direction se fait &agrave; partir d\'une console de pilotage portative .<br />L\'evolution est la m&ecirc;me qu\'un voilier traditionnel, et l\'on doit apprendre et maitriser la technique de la Voile pour se diriger et regler sa voilure en fonction de la direction du vent.&nbsp;<br />Des regates sont organis&eacute;es autour de 3 bou&eacute;es , et les concurents font effectuer &nbsp;le meme parcours &agrave; leur bateau.&nbsp;<br />Le Club compte parmis ses membres une &eacute;quipe de r&eacute;gatiers du plus haut niveau national et international.<br />Le Club poss&egrave;de 6 bateaux qu\'il met &agrave; disposition de ses membres.', 'ADMIN', 'Alvernhe Thierry', '2017-11-15 16:26:00', '2017-12-31 01:57:08'),
(4, 'pratique_croisiere', 'Pratique de la croisiere', 'L\'USC Voile propose des cours d\'initiation &agrave; la croisiere pour ceux que cela interesse.<br />Ainsi il peuvent apprendre sur le Plan d\'eau de La Roucari&eacute; la navigation abord d\'un NEPTUNE , mini croiseur de 5.50 metres , pour s\'initier aux manoeuvres de voiles ,&nbsp;<br />prise de ris, mont&eacute;e du spinnaker, navigation sur toutes les allures : pres vent arriere largue , etc...<br /><br />Ensuite le Club propose des sorties en Mer abord d\'un voilier plus important , ou l\'on peut vivre , manger et dormir abord. Pour cel&agrave; il faut se rendre en Mediterran&eacute;e selon un programme pre &eacute;tabli , avec toutes les conditions de s&eacute;curit&eacute; qui s\'imposent.', 'ADMIN', 'Alvernhe Thierry', '2017-11-15 16:27:50', '2017-12-31 01:57:48'),
(5, 'entrainements', 'Le club vous propose divers entrainements', 'Les entrainements hebdomadaires du samedi apres midi &nbsp;permettent de se retrouver r&eacute;guli&egrave;rement et de naviguer ensemble .<br />Pour les 7 a 14 ans , ce sera en OPTIMIST, toujours dans un but d\'apprendre &agrave; se servir d\'un voilier quelles que soient les conditions de vent.<br />Apres 14 ans , en fonction des preferences de chacun de leur gabarit, certains s\'orienterons vers la Planche &agrave; Voile , d\'autres vers le deriveur double ou solitaire.<br /><br />Des entrinement d\'hiver sont egalement prosos&eacute;s sur l\'&eacute;tang de Thau selon un plnning pre etabli. Cela s\'adresse &agrave; des pratiquants plus exp&eacute;riment&eacute;s.', 'ADMIN', 'Alvernhe Thierry', '2017-11-15 16:41:35', '2017-12-31 01:58:16'),
(6, 'moniteur1', 'Philippe CHELLE', '<span style="font-family: arial,helvetica,sans-serif; font-size: 12px;">BEES 2 <br />Entraineur F&eacute;d&eacute;ral regional<br />Evaluateur de niveau 5 en DER et PAV<br /> Experience : Planche a voile, Laser,&nbsp; Croisiere.&nbsp; <br /></span>', 'ADMIN', 'Alvernhe Thierry', '2017-11-15 16:41:38', '2017-12-31 02:16:54'),
(7, 'moniteur2', 'Thierry ALVERNHE', '<div><span style="font-family: arial,helvetica,sans-serif; font-size: 12px;"><img style="display: block; margin-left: auto; margin-right: auto;" src="https://scontent-cdg2-1.xx.fbcdn.net/v/t1.0-9/18813557_1237714513008131_7837201534428087699_n.jpg?oh=587713bf88e7bb3578a1c36da4bc4ef6&amp;oe=5AB31D4D" width="200" height="200" /><br />BEES 1<br /> Entraineur F&eacute;d&eacute;ral regional<br />Evaluateur de niveau 5 en DER et PAV<br /> Experience: Planche a voile, Laser, Croisiere</span></div>', 'ADMIN', 'Alvernhe Thierry', '2017-11-15 16:41:39', '2017-12-31 02:19:51'),
