t-size: 13px;">06.38.91.05.48</div>\n</td>\n<td style="width: 33.3333%;">&nbsp;</td>\n<td style="width: 33.3333%;">&nbsp;</td>\n</tr>\n</tbody>\n</table>', 'ADMIN\n', 'Alvernhe Thierry', '2017-11-23 06:41:33', '2017-12-22 10:43:34'),
(9, 'apropos', 'Union Sportive Carmaux Voile', 'Notre association exerce ses activités nautiques depuis 1961 sur le plan d ’eau de la Roucarié près de Monestiés, a quelques kilomètres d’Albi, d ans un cadre de verdure et de calme.<br>\nC’est une réserve d’eau potable, ou une zone a été aménagée pour la baignade  et où nous vous proposons de passer quelques journées de vos vacances.<br>\nNotre Base Nautique tournée essentiellement vers la voile possède les labels  de qualité décernés par la Fédération Française de Voile, et à ce titre nous  vous proposons un enseignement performant avec des moniteurs  diplômés d’état.<br>\nStages d’initiation ou de perfectionnement, leçons particulières, ou  tout simplement locations, nous vous offrons la possibilité d’utiliser notre  parc de matériel, divers et varié, en veillant à votre sécurité et à celle de  vos enfants.<br>\nNos structures d’accueil vous permettent de venir pique-niquer au bord de  l’eau et d’utiliser notre terrasse et barbecue.<br>\nLe temps des vacances c’est également le temps des Loisirs avec  L’U.S.C VOILE.<br>\nC’est pourquoi, nous vous invitons à passer nous voir !!', NULL, NULL, '2017-11-23 06:57:24', NULL),
(10, 'cours_particuliers', 'Les Cours Particuliers', 'Ces cours permettent aux d&eacute;butants ou aux initi&eacute;s d\'apprendre &agrave; se perfectionner dans l\'activit&eacute; voile, sur le support de leur choix, tout en &eacute;tant accompagn&eacute; individuellement par un Moniteur qualifi&eacute;.<br /> Les cours sont individuels et personnalis&eacute;s, et sont limit&eacute;s &agrave; 3 personnes maximum pour une efficacit&eacute; optimis&eacute;e.<br /> La souscription du Passeport voile est obligatoire pour les non licenci&eacute;s FFV.', 'ADMIN', 'ADMIN', '2017-11-23 15:40:14', '2017-12-14 17:16:11'),
(11, 'stages', 'Les Stages', 'Ces stages d\'initiation et/ou perfectionnement ont pour objectif d\'apprendre ou de se perfectionner dans l\'activit&eacute; voile.<br /> Ils s\'appuient sur des cours th&eacute;oriques et pratiques encadr&eacute;s par un Moniteur qualifi&eacute;.<br />Ces stages se deroulent sur 3 ou 5 demies journ&eacute;es.<br /> Les s&eacute;ances ont un suivi p&eacute;dagogique avec une progression logique en fonction du niveau des &eacute;l&egrave;ves. Attention: la souscription du Passeport Voile est obligatoire pour les non licenci&eacute;s FFV.<br />Prendre contact avec les moniteurs de Voile pour connaitre les stages programm&eacute;s.<br />Vous avez la possibilit&eacute; si vous etes un groupe constitu&eacute; de 4 personnes ou plus de voir avec le moniteur s\'il a la possibilit&eacute; de monter un stage specifique &agrave; votre demande.<br />Il existe des stages multisupports , generalement sur 5 demi journ&eacute;es &nbsp;, o&ugrave; on alterne les divers supports &nbsp;comme le deriveur, le paddle, la planche a voile , le catamaran , le Kayack, etc....', 'ADMIN', 'Alvernhe Thierry', '2017-11-23 15:40:14', '2017-12-31 02:00:35'),
(12, 'groupes', 'Les activités de groupe', '<strong>GROUPES DE JEUNES CONSTITUES.</strong><br /><br />pour les groupes de jeunes comme les colonnies,centres a&eacute;r&eacute;s, maison de jeunesse, etc<br />nous assurons un encadrement avec un enseignement &nbsp;pedagogique &nbsp;adapt&eacute; &agrave; l\'age des stgiaires. Les sc&eacute;ances &nbsp;sont generalement de deux heures, et chaque moniteur peut encadrer jusqu\'&agrave; 10 embarcations. nous devons connaitre au pr&eacute;alable le nombre de stagiaires , leur age, le support qu\'ils aimeraient pratiquer.<br />Des tarifs de groupes sont prevus &nbsp;pour ce type de public, avec des prix degressifs en fonction du nombre de s&eacute;ances reserv&eacute;es.', 'ADMIN', 'Alvernhe Thierry', '2017-11-23 15:40:55', '2017-12-31 01:59:42'),
(13, 'cours_particuliers_conditions', 'Conditions d\'acces aux cours particuliers', 'Ces cours permettent aux débutants ou aux initiés d\'apprendre à se perfectionner dans l\'activité voile, sur le support de leur choix, tout en étant accompagné individuellement par un Moniteur qualifié.\r\n\r\nLes cours sont individuels et personnalisés, et sont limités à 3 personnes maximum pour une efficacité optimisée.\r\n\r\nLa souscription du Passeport voile est obligatoire pour les non  licenciés FFV', 'ADMIN', NULL, '2017-11-23 15:40:14', NULL),
(14, 'stages_conditions', 'Conditions d\'acces aux stages', 'Ces stages d\'initiation et/ou perfectionnement ont pour objectif d\'apprendre ou de se perfectionner dans l\'activité voile.\r\n\r\nIls s\'appuient sur des cours théoriques et pratiques encadré par un Moniteur qualifié.\r\n\r\nLes séances ont un suivi pédagogique avec une progression logique en fonction du niveau des élèves.\r\n\r\nAttention: la souscription du Passeport Voile est obligatoire pour les non licenciés FFV.', 'ADMIN', NULL, '2017-11-23 15:40:14', NULL),
(15, 'groupes_conditions', 'Conditions d\'acces aux activitées de groupe', 'Nous accueillons les centres aérer, les écoles, les familles, ou les sociétés et organisont des activitée de groupes variés et conviviales. ', 'ADMIN', NULL, '2017-11-23 15:40:55', NULL),
(16, 'reservation', 'Les Reservations', 'Toute reservation doit etre effectuer au minimum 48h avant la date choisit.<br />Pensez a pr&eacute;ciser la plage horaire souhait&eacute;, l\'age des participants ou tout autre d&eacute;tail vous parainnant pertinant dans la section message.', 'ADMIN', 'Alvernhe Thierry', '2017-11-15 14:58:39', '2017-12-22 11:13:24'),
(17, 'footer', 'Pied de page', 'L\' US CARMAUX VOILE exerce son activit&eacute; sur le barrage de la Roucari&eacute; , sur la commune de Monesti&eacute;s, depuis 1961. Le plan d\'eau de 64 hectares permet la pratique de la voile sous toutes ses formes . Planches &agrave; Voile, D&eacute;riveurs doubles ou solitaires, micro, mais aussi la Voile Radio-command&eacute;e. Le Palmar&egrave;s du Club est &eacute;loquent, avec des comp&eacute;titeurs qui ont particip&eacute; &agrave; des Championnat du Monde , d\'Europe ou maintes r&eacute;gates internationales, et des titres honorables obtenus en 470, LASER, et Voile Radio-command&eacute;e. C\'est particuli&egrave;rement dans cette derni&egrave;re cat&eacute;gorie qu\'excelle les coureurs de l\'USC Voile en pla&ccedil;ant r&eacute;guli&egrave;rement le club depuis plusieurs ann&eacute;es dans les 3 premi&egrave;res places du classement national des clubs. Mais l\'USC Voile c\'est aussi une ecole de Voile , o&ugrave; sont organis&eacute;s des cours et des stages d\'initiation, de perfectionnement, de comp&eacute;tition, et de formation de moniteurs de Voile. Plusieurs Educateurs et Moniteurs diplom&eacute;s travaillent au sein du club pour apporter un enseignement de qualit&eacute;. C\'est aussi , une large ouverture vers la voile Loisir , avec les planches &agrave; voile et les catamarrans qui peuvent &ecirc;tre lou&eacute;s sur place. La Base Nautique qui offre des structures adapt&eacute;es &agrave; l\'activit&eacute; Voile , est ouverte du mois de Mars &agrave; fin Novembre . Des comp&eacute;titions sont organis&eacute;es chaque ann&eacute;es sur le plan d\'eau de la Roucari&eacute;. Le Camping g&eacute;r&eacute; par l\'USC VOILE permet d\'accueillir les particuliers, familles et groupes durant toute la p&eacute;riode estivale.', 'ADMIN', 'Alvernhe Thierry', '2017-11-15 14:58:39', '2017-12-23 11:36:04'),
(18, 'download', 'Les Téléchargements', 'Vous trouverez ici tout ce dont vous aurez besoins.', NULL, 'Alvernhe Thierry', '2017-12-28 15:03:54', '2017-12-28 22:24:21'),
(19, 'moniteur3', 'Olivier Cazes', '<div><span style="font-family: arial,helvetica,sans-serif; font-size: 12px;"><img style="display: block; margin-left: auto; margin-right: auto;" src="https://scontent-cdg2-1.xx.fbcdn.net/v/t1.0-9/12347960_1249985845027186_788814770178658612_n.jpg?oh=898a581374306f77830c575bc81a914d&amp;oe=5AB90D2F" alt="" width="200" height="200" /><br /> Moniteur F&eacute;d&eacute;ral regional<br /> Experience: Planche a voile, Laser, Croisiere</span></div>', 'ADMIN', 'Alvernhe Thierry', '2017-11-15 16:41:39', '2017-12-31 02:25:23'),
(20, 'moniteur4', 'Jeremy Thiroux', '<div><img style="display: block; margin-left: auto; margin-right: auto;" src="https://scontent-cdg2-1.xx.fbcdn.net/v/t1.0-9/1454715_10206066231244160_156812458732871921_n.jpg?oh=7a1c63816cc9a144e7ce5195895941c4&amp;oe=5AB085B3" alt="" width="200" height="200" /></div>\nMoniteur CQPAMV<br />en formation BJEPS', 'ADMIN', 'Alvernhe Thierry', '2017-11-15 16:41:38', '2017-12-31 02:28:04'),
(21, 'moniteur5', 'Les Arbitres Officiels', '<div style="text-align: center;"><span style="font-family: arial,helvetica,sans-serif; font-size: 12px;"><strong>Thierry Alvernhe</strong> &nbsp; &nbsp; Comite de course regional<br /> <strong>David SWIATEK</strong> &nbsp; &nbsp;Jury de course regional&nbsp;<br /> <strong>Christian Fabre</strong> &nbsp; &nbsp; comite/jury course Club<br /><strong>Yannick Rossignol</strong> &nbsp; &nbsp;comite/jury course Club<br /> <strong>Olivier Cazes</strong> &nbsp; &nbsp; &nbsp;comite course club<br /> <strong>Jeremy Thiroux</strong> &nbsp;&nbsp;comite course club</span></div>', 'ADMIN', 'Alvernhe Thierry', '2017-11-15 16:41:39', '2017-12-31 02:39:48');
